import React from 'react';
import { Link } from 'react-router-dom';

class Nav extends React.Component {
    render() {
        return (
            <div className="nav">
                <Link to="/">Home</Link>    
                <Link to="/about-us">Meet the Band!</Link>
                <Link to="/contact-us">Book a Gig!</Link>
                <Link to="/gallery">Gallery</Link>
            </div>
        )
    }
}

export default Nav;
